import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router } from "react-router-dom";
import './index.css'
import ThemeContextProvider from "./ThemeContext";
import App from "./App";


ReactDOM.render(
  <Router>
    <ThemeContextProvider>
      <App />
    </ThemeContextProvider>
  </Router>,
  document.getElementById("root")
);
